script: |
  super -f text -I q3600.spq | sort > q3600.out

inputs:
  - name: q3600.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE NULL NOT BETWEEN + ( - - col0 ) * + col0 + col0 AND + CAST ( NULL AS INTEGER ) * + col2 / - 8 / - + col0;
  - name: tab0

outputs:
  - name: q3600.out
    data: |
